const Aboutus_service = () =>{
    return(
          <>
          <div className="container">
            <center>
            <span style={{fontWeight:"300"}}>Explore our <span style={{fontWeight:"800"}}>Services</span></span>
            </center>
          </div>
          </>
    )
}
export default Aboutus_service;
